import React from "react";

const Header = props => {
  let time = `Time: ${Math.floor(props.timer)}s`;

  return (
    <div className="board-head">
      <div className="flag-count">{props.flagCount}</div>
      <div className="board-head">{time}</div>
    </div>
  );
};

export default Header;
